import React, { Component } from 'react'
import "./"
import Nav from "../Nav/Nav"

export default class Header extends Component {
    render() {
        return (
            <div className='header'>
                <div className='header__container'>
                    <Nav />
                </div>
            </div>
        )
    }
}
